import Home from '~/pages/Home';
import Forum from '~/pages/Forum';
import Login from '~/pages/Login'
const publicRoutes = [
    { path: '/', component: Home },
    { path: '/forum', component: Forum },
    { path: '/login', component: Login, layout: null},

];

const privateRoutes = [];

export { publicRoutes, privateRoutes };
